func getMessages(rows *sql.Rows) ([]string, error) {
	var messages []string

	for rows.NextResultSet() {
		for rows.Next() {
			var message string
			if err := rows.Scan(&message); err != nil {
				return nil, err
			}
			messages = append(messages, message)
		}
	}

	if err := rows.Err(); err != nil {
		return nil, err
	}

	return messages, nil
}
